                        (err, result) => {
                            if (err) {
                                res.status(500).json({
                                    message: err,
                                })
                            } else {
                                //aqui se autentica
                                aux[0].roles = result;
                                var payload={
                                    aux
                                };
                                //var a= JSON.stringify(result)
                                //var b=a.replace(/[{}]/gi,'');
                                //b=b.replace('[','');
                               // b=b.replace(']','');
                                //b=JSON.parse(a)
                                
                                jwt.sign(payload,secret,{ expiresIn: 300},function(error,token){
                                    if(error){
                                       console.log(error)
                                    }else{
                                        aux[0].token=token;
                                        res.status(200).json(aux[0]);
